import React, { Component } from "react";

module.exports= class UserDashboard extends Component {
  componentDidMount() {
    fetch("http://localhost:5000/usersDashboard", {
      method: "POST",
      crssDomain: true,
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
        "Access-Control-Allow-Origin": "*",
      },
      body: JSON.stringify({
        token: window.localStorage.getItem("token"),
      }),
    })
      .then((data) => {
        console.log(data,"Usersdata");
      });
  }



  render() {
    return <div>

    </div>;
  }
}
